export default function Login() {
  // function submitHandler() {}
  return (
    <div className="Login">
      <form>
        <div>
          <label>Username</label>
          <input type="text" name="username" placeholder="Username">
            Username
          </input>
        </div>
        <div>
          <label>Password</label>
          <input type="password" name="password" placeholder="Password">
            Password
          </input>
        </div>
      </form>
    </div>
  );
}
